description:
Jessica (Nanda Costa), Sabrina (Amanda Diniz) e Daiane (Kika Farias) sonham como qualquer outra jovem do mundo. Moradoras de uma comunidade do Rio de Janeiro, eventualmente se prostituem para sobreviver e satisfazer seus desejos de consumo. No entanto, mesmo nesse quadro de absoluta incerteza e total falta de horizontes, elas teimam em amar, se divertir e sonhar com um futuro melhor.

